import './App.css';

import Home from './pages/Home'

import React from 'react'
import {BrowserRouter, Route, Routes} from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route exact path='/' element={<Home/>}/>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
